const PartyList = ({ peoples }) => {

    return (
    <>
      <ul>
        {peoples.map((e) => (
          <li key={e.name}>
            <h2>{e.name}</h2>
            <h2>{e.age}</h2>
          </li>
        ))}
      </ul>
      <h1>maior 18</h1>
      <ul>
        {peoples
          .filter((e) => e.age >= 18)
          .map((e) => (
            <li key={e.name}>
              <h2>{e.name}</h2>
              <h2>{e.age}</h2>
            </li>
          ))}
      </ul>
      <h3>{peoples.reduce((a, e) => a + e.age, 0) / peoples.length}</h3>
    </>
  );
};

export default PartyList;
